import React from 'react';
import {arrowLeft, arrowRight} from "../Images";

class CharacterChoice extends React.Component {
    constructor(props){
        super()
    }

    render() {
        return (
            <div id="CharacterSelection">
                <img src={arrowLeft} alt="Left Arrow" onClick={this.props.onClickRight} />
                <img src={arrowRight} alt="Right Arrow" onClick={this.props.onClickLeft}/>
            </div>
        );
    }
}

export default CharacterChoice;
